import React from 'react';
import './OptionsSection.css'

function OptionsSection() {
    return (
        <div>
            <select name="size" id="size">
                <option value="4011">Small</option>
                <option value="4012">Medium</option>
                <option value="4013">Large</option>
                <option value="4014">Extra Large</option>
            </select>
            <input id="fullName" type ="text" placeholder="Full Name"/>
            <input id="email" type ="email" placeholder="Email"/>
            <input id="address" type="address" placeholder="Address"/>
            <input id ="city" type="city" placeholder="City"/>
            <input id ="state" type="state" placeholder="State"/>
        </div>
    );
};
export default OptionsSection;
